import { Logo } from '../../../Assets/Svgs'


export const Navbar = () => {
    return (
        <Container>
            <div>
                <Link>About us</Link>
                <Link>Sell on ginger</Link>
            </div>

            <div>
                <Logo/>
            </div>

            <div>

            </div>
        </Container>
    )
}


const Container = styled.nav`
    width: 100%;
    padding: 0 10%;
    align-items: center;
    justify-content: space-between;
`
